import React from 'react'; // import the React library
import './index.css';

const Title = (props) => {
    let {delItem, its, onClick, smp} = props
    return (
        <React.Fragment> 
            <ul>
                {
                    props.its.map((el,idx)=>(
                            <li onClick={()=>props.delItem(idx)} key={`listItem${idx}`}> {el} </li>
                        )
                    )
                }

            </ul>
            <button className="Align" onClick={() =>props.onClick()} >The Button</button>
            <div>
                {
                    props.smp.map((element, index) => (
                        <p key={`happy${index}`}>{element} {index}</p>
                        )
                    )
                }
            </div>
        </React.Fragment>
    )
}
export default Title;
